export default function NotebookLogo({ size = 26 }) {
  return (
    <svg
      height={size}
      viewBox="0 0 24 24"
      fill="currentColor"
      className="text-gray-700"
    >
      <path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 
               10-4.48 10-10S17.52 2 12 2zm-.25 15l-1.41-1.41 
               2.34-2.34-2.34-2.34L11.75 9l3.75 3.75-3.75 3.75z" />
    </svg>
  );
}
